import React from "react";
import "../src/css/result.css";
function Result() {
  const bs1 = {
    type: "SOLO",
    map: "ERANGLE",
    date: "01/01/2004",
    time: "10:00 am",
  };
  const bs2 = {
    type: "SOLO",
    map: "ERANGLE",
    date: "01/01/2004",
    time: "11:00 am",
  };
  const bsd = {
    type: "SQUAD",
    map: "ERANGLE",
    date: "01/01/2004",
    time: "12:00 am",
  };
  const fs1 = {
    type: "SOLO",
    map: "BERMUDA",
    date: "01/01/2004",
    time: "10:00 am",
  };
  const fs2 = {
    type: "SOLO",
    map: "BERMUDA",
    date: "01/01/2004",
    time: "11:00 am",
  };
  const fsd = {
    type: "SQUAD",
    map: "BERMUDA",
    date: "01/01/2004",
    time: "12:00 am",
  };
  return (
      <div className="rmain">
        <div className="rbody">
          <div>GAME</div>
          <div>TYPE</div>
          <div>MAP</div>
          <div>DATE</div>
          <div>TIME</div>
          <button>SHOW RESULT</button>
        </div>
      </div>
  );
}
export default Result;
